import React from 'react';
import logo from './logo.svg';
import {Navbar, NavbarBrand} from 'reactstrap';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Navbar dark color="primary">
          <div className="container">
            <NavbarBrand href="/">
              Movie Fanatic Club
            </NavbarBrand>
          </div>
        </Navbar>
      </header>
    </div>
  );
}

export default App;
